const impermaxFilter=(e,r,l=!1)=>{const o=[];document.querySelectorAll(".pairs-table-row").forEach(e=>o.push(e));const t=o.map(e=>e.querySelectorAll(".col")[2]).filter(e=>e).map(e=>[e.querySelectorAll("div")[0].innerHTML,e.querySelectorAll("div")[1].innerHTML].map(e=>parseFloat(e.split("%")[0])/100)),c=o.map(e=>e.querySelectorAll(".col")[3]).filter(e=>e).map(e=>[e.querySelectorAll("div")[0].innerHTML,e.querySelectorAll("div")[1].innerHTML].map(e=>parseFloat(e.split("%")[0])/100)),n=o.map(e=>e.querySelectorAll(".col-5 .percentage")).filter(e=>e).map(e=>parseFloat(e[0].innerHTML.split("%")[0])/100),a=o.map(e=>e.querySelector(".col-7 .symbols").innerHTML),i=o.map(e=>e.querySelector(".col-7 .amm-label").innerHTML),p=o.map(e=>e.href);let s=a.map((e,r)=>e.split("/").map((e,l)=>({token:e,pair:a[r],source:i[r],supply:t[r][l],borrow:c[r][l],farm:n[r],href:p[r],row:o[r]}))).reduce((e,r)=>[...e,...r],[]).filter(r=>e.includes(r.token));if(s=s.sort((e,l)=>"borrow"==r?e[r]-l[r]:l[r]-e[r]),l){document.querySelectorAll(".pairs-table-row").forEach(e=>e.remove());const e=document.querySelector(".pairs-table");s.forEach(r=>{const l=r.row.cloneNode(!0);l.innerHTML=l.innerHTML.replace(r.token,`<b>${r.token}</b>`);const o=r.pair.split("/").indexOf(r.token);l.querySelectorAll(".col, .currencies-rows-icon").forEach(e=>e.querySelectorAll("div")[(o+1)%2].remove()),e.insertAdjacentElement("beforeend",l)})}return s};
